import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { Provider } from 'react-redux';
import store from './Redux/store'; 
import Inicio from './Components/Inicio/Inicio.jsx';
import AHome from './Components/Ahome/Ahome.jsx';
import Delete from './Components/Delete/Delete';

function App() {
  return (
    <Provider store={store}>
    <Router>
      <Routes>
        <Route path="/" element={<Inicio />} />
        <Route path="/pokemons" element={<AHome/>} />
        <Route path="/pokedetail/:id" element={<AHome/>} /> //?falta
        <Route path="/managepoke" element={<AHome/>} /> //?falta
        <Route path="/createpoke" element={<AHome/>} /> //?falta
        <Route path="/deletepoke" element={<Delete/>} /> //?falta

      </Routes>
    </Router>
    </Provider>
  );
}

export default App;
